import React, { useState, useEffect } from 'react';
// import logo from './logo.svg';
import './App.css';



function App() {

  const [users, setUsers] = useState([])

  useEffect(() => {
    fetch('/users')
      .then(res => res.json())
      .then(users => setUsers(users))
  });

  return (
    <div className="App">
      <h1>Users</h1>
      <ul>
        {users.map(user  =>
        <li key = {user.id}>{user.username}</li>)}
      </ul>
    </div>
  )
}

export default App;
